  overflow: hidden;
  padding-bottom: 5px; }
  .dataTables_wrapper .dataTables_length {
    color: #313435;
    float: left; }
    @media screen and (max-width: 767px) {
      .dataTables_wrapper .dataTables_length {
        text-align: left; } }
    .dataTables_wrapper .dataTables_length select {
      border: 1px solid rgba(0, 0, 0, 0.0625);
      border-radius: 2px;
      -webkit-box-shadow: none;
              box-shadow: none;
      height: 35px;
      font-size: 14px;
      padding: 5px;
      margin-left: 5px;
      margin-right: 5px;
      color: #72777a;
